import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import NotificationPage from './NotificationPage';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={NotificationPage} />
      </Switch>
    </Router>
  );
};

export default App;
